import React from 'react';
import BudgetSummary from '../BudgetSummary';

const incSummary = props => {

    const summary = props.incomeSummary.map(inc => {
        return (
            <li key={inc.des}><div>{inc.des}</div> <div>{inc.val}</div></li>
        );
    })

    return (
        <BudgetSummary>
            <h1>incomes</h1>
            <ul>
                {summary}
            </ul>
        </BudgetSummary>
    );
}

export default incSummary;
